css:
.react-tabs {
  flex: 1;
  display: flex;
  flex-direction: column;
}
.react-tabs__tab-panel--selected {
  flex: 1;
  overflow: auto;
}
.github-tab {
  padding: 5px 15px;
  text-align: center;
  font-weight: 600;
  color: #717171;
  cursor: default;
  user-select: none;
}
.github-tablist {
  flex: none;
  display: flex;
  justify-content: center;
  padding: 0;
  margin: 0;
  list-style: none;
  border-bottom: 1px solid #e0e0e0;
  background-color: #f0f0f0;
}
.github-tab-icon {
  color: #b8b8b8;
  vertical-align: middle;
}
.github-tab-icon:before {
  margin-right: .4em;
}
.github-tab-count {
  display: inline-block;
  background-color: #dddddd;
  border-radius: 3px;
  padding: 0 .25em;
  margin-left: 5px;
}
.github-tab.react-tabs__tab--selected {
  color: #0a0a0a;
  box-shadow: 0 1px 0 #5a8ae9;
}
.github-tab.react-tabs__tab--selected .github-tab-icon {
  color: #474747;
}
